import React from "react";
import classes from "./detail.module.scss";
import Breadcrumps from "../components/Breadcrumps";

const Detail = () => {
  return (
    <div className={classes.detail}>
      <Breadcrumps />
      <div className={classes.picture}></div>
    </div>
  );
};

export default Detail;
